import React,{Component} from 'react';
import '../App/App.css';
import Task from "../Atoms/Tasks.js";
import imag from "./car_wash.jpeg";
import axios from 'axios';

function GetTasks() {
  axios.get('http://192.168.1.237:3200/task')
  .then(response => {
    console.log(response.data)
    const { data } = response.dataSetUserData(data)
  }).catch(error => {
    console.log(error);
  });

  //return json;
}

export class Feed extends Component {
    render() {
        GetTasks()
        return (
            <div>
                <Task 
                img={imag}
                name={"Car Wash"}
                price={"25"}
                description={"I need my fucking car wash today. dont scratch it or ill kill yuo"}
                location={"420 ave"}
                deadline = {"today bitch"}
                />
            </div>
        )
    }
}

export default Feed
